import React, { useState } from 'react'
import { useNavigate } from 'react-router-dom'
import goBack from '../../assets/back.png'
import './CreateOrder.css'

const CreateOrder = () => {
    const navigate = useNavigate()
  
    const [loading, setLoading] = useState(false)
    const [erorr, setError] = useState("errr")



  return (
    <div className='CreateOrder-con'>
        <img className='createCoffeNetwork-imgBack' onClick={() => navigate("/")} src={goBack} alt="" />

          <h1 className='CreateOrder-title'>Create order</h1>
          <form className='CreateOrder-form'>
  <input className='CreateOrder-form-input' type="text" placeholder='userId'/>
  <input className='CreateOrder-form-input' type="text" placeholder='productid'/>
  <input className='CreateOrder-form-input' type="text" placeholder='quantity'/>

   {erorr && <p className='CreateOrder-mistake'>{erorr}</p>}

  <button className='CreateOrder-form-btn'>Create order</button>
</form>


    </div>
  )
}

export default CreateOrder
